import React from 'react'
import axios from 'axios'
import arrow from '../../assets/arrow.png'

let data=[
    {
        Building:'1',
        RoomId:'Lobby',
        Sensors:'3',
        CurrentPopulation:'3'
    },
    {
        Building:'1',
        RoomId:'Room1',
        Sensors:'3',
        CurrentPopulation:'3'
    },
    {
        Building:'1',
        RoomId:'Room2',
        Sensors:'3',
        CurrentPopulation:'3'
    }
]

const CardList = () =>{
    return(
        <div className="d-flex justify-content-center align-items-center flex-column" style={{backgroundColor:'#EEEEEE', height:'auto',width:'100%'}}>
            {
                data.map((element) =>{
                    return(
                        <div className="mt-4" style={{height:"200px",width:"80%"}}>
                            <div className="pl-4 d-flex align-items-center" style={{backgroundColor:'#E3E3E3',height:'20%',borderRadius:'7px 7px 0px 0px',border:'solid black 0.5px', borderColor:'#909090'}}>
                                {element.RoomId}
                            </div>
                            <div className="d-flex justify-content-start align-items-center" style={{height:"80%", backgroundColor:'white',borderRadius:'0px 0px 7px 7px',border:'solid black 0.5px',borderTopStyle:'none', borderColor:'#909090'}}>
                                <div className="ml-5 d-flex align-items-center" style={{backgroundColor:'#EFEFEF', width:'400px',height:'70px', borderRadius:'7px'}}>
                                    <div className="ml-4">Current Population : {element.CurrentPopulation}</div>
                                    <div className="d-flex justify-content-center align-content-center">
                                        <img style={{width:'20px'}} src={arrow} />    
                                    </div>
                                </div>
                            </div>
                        </div>
                    )
                })
            }
        </div>
    )
}

export default CardList
